import React from 'react';
import './Home.css';

const Home = () => {

    return (
        <>
            <div className='flex'>
                <div className={'w-72 h-screen custom-shadow-home'}>
                    <img src="https://i.ibb.co/HGZkXHv/Nutri-mate-logo.png" alt="Logo" className='absolute cursor-pointer
                    right-3 top-9 w-7 bord'/>
                </div>
                <div className='p-7 text-2xl font-semibold flex-1 h-screen'>
                    <h1>Home Page</h1>
                </div>
            </div>
        </>
    );
};

export default Home;
